import React from 'react'
import './styles.css'
import heroImage from "../../assets/images/heroimage.jpg"
export default function Introduction() {
    return (
        <div class="hero-image">
            <img src={heroImage} width='100%' height='auto' />
            <div class="hero-text">
                <h1>Giới thiệu</h1>
            </div>
        </div>
    )
}
